import React, { useState } from "react";

export default function QuantumSimulator() {
  const [bit1, setBit1] = useState(null);
  const [bit2, setBit2] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  async function runSimulation() {
    if (bit1 === null || bit2 === null) {
      alert("Please select both bits.");
      return;
    }
    setLoading(true);
    setResult(null);
    try {
      const response = await fetch("http://localhost:5000/simulate", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ bit1, bit2 }),
      });
      const data = await response.json();
      setResult(data);
    } catch (error) {
      alert("Error communicating with the backend.");
    }
    setLoading(false);
  }

  return (
    <div style={{
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      maxWidth: 800,
      margin: "2rem auto",
      padding: "1.5rem",
      backgroundColor: "#fefefe",
      borderRadius: 8,
      boxShadow: "0 0 10px rgba(0,0,0,0.1)"
    }}>
      <h1 style={{ textAlign: "center", color: "#003366", marginBottom: 30 }}>
        Superdense Coding Demo
      </h1>

      {/* Bit Selection Panel */}
      <section style={{
        border: "1px solid #c1d1e8",
        borderRadius: 8,
        padding: "1rem 1.5rem",
        marginBottom: 30,
        backgroundColor: "#e8f0fe"
      }}>
        <h2 style={{ color: "#004080" }}>Choose Classical Bits to Transmit</h2>
        <p><strong>Current Selection:</strong> {bit1 !== null && bit2 !== null ? `${bit1}${bit2}` : "--"}</p>
        <label style={{ marginRight: 20 }}>
          Bit 1:{" "}
          <select value={bit1 ?? ""} onChange={e => setBit1(e.target.value)} style={{ padding: "6px" }}>
            <option value="" disabled>Select</option>
            <option value="0">0</option>
            <option value="1">1</option>
          </select>
        </label>
        <label>
          Bit 2:{" "}
          <select value={bit2 ?? ""} onChange={e => setBit2(e.target.value)} style={{ padding: "6px" }}>
            <option value="" disabled>Select</option>
            <option value="0">0</option>
            <option value="1">1</option>
          </select>
        </label>
      </section>

      {/* Visual Process Representation */}
      <section style={{
        border: "1px solid #c1d1e8",
        borderRadius: 8,
        padding: "1rem 1.5rem",
        backgroundColor: "#eef6ff",
        marginBottom: 30
      }}>
        <h2 style={{ color: "#004080", marginBottom: 15 }}>Visual Process Representation</h2>

        {/* Qubit States */}
        <div style={{ fontSize: 24, fontWeight: 600, color: "#1a237e", marginBottom: 25 }}>
          |0⟩&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;|0⟩
        </div>

        {/* Quantum Circuit Diagram */}
        <div style={{ display: "flex", gap: 60, marginBottom: 30 }}>
          <div>
            <h4 style={{ color: "#003366", marginBottom: 6 }}>Qubit A</h4>
            <p>H</p>
            <p>X</p>
            <p>Z</p>
          </div>
          <div>
            <h4 style={{ color: "#003366", marginBottom: 6 }}>Qubit B</h4>
            <p>Measurement</p>
            <p>Bell Basis</p>
          </div>
        </div>

        {/* Steps */}
        <ol style={{ lineHeight: 1.6, color: "#062f4f" }}>
          <li><strong>Entanglement:</strong> Create Bell state Φ⁺</li>
          <li><strong>Encoding:</strong> Apply X/Z gates based on bits</li>
          <li><strong>Transmission:</strong> Send qubit A</li>
          <li><strong>Decoding:</strong> Bell measurement</li>
        </ol>
      </section>

      {/* Run Simulation Button */}
      <div style={{ textAlign: "center", marginBottom: 40 }}>
        <button
          onClick={runSimulation}
          disabled={loading}
          style={{
            backgroundColor: "#004080",
            color: "white",
            borderRadius: 6,
            border: "none",
            padding: "12px 28px",
            fontSize: 18,
            cursor: loading ? "not-allowed" : "pointer",
            boxShadow: "0 3px 6px rgba(0,0,0,0.16)"
          }}>
          {loading ? "Simulating..." : "Run Simulation"}
        </button>
      </div>

      {/* Results */}
      <section style={{
        border: "1px solid #c1d1e8",
        borderRadius: 8,
        padding: "1rem 1.5rem",
        backgroundColor: "#f0f4ff"
      }}>
        <h2 style={{ color: "#004080", marginBottom: 20 }}>Results</h2>
        <p><strong>Original Bits:</strong> {result ? result.original_bits : "--"}</p>
        <p><strong>Received Bits:</strong> {result ? result.measured_bits : "--"}</p>
      </section>
    </div>
  );
}
